import React from 'react';
import { Link } from 'react-router-dom';

const NavigationBar = () => {
  return (
    <nav style={{ 
      padding: '10px', 
      backgroundColor: '#333', 
      marginBottom: '20px' 
    }}>
      <ul style={{ 
        listStyleType: 'none', 
        margin: 0, 
        padding: 0, 
        display: 'flex' 
      }}>
        <li style={{ marginRight: '20px' }}>
          <Link 
            to="/" 
            style={{ 
              color: 'white', 
              textDecoration: 'none',
              fontSize: '18px'
            }}
          >
            Home
          </Link>
        </li>
        <li>
          <Link 
            to="/terminal" 
            style={{ 
              color: 'white', 
              textDecoration: 'none',
              fontSize: '18px'
            }}
          >
            Terminal
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavigationBar;
